body:
It's calling the OrtSessionOptionsAppendExecutionProvider_CUDA entry point but failing to find the necessary CUDA libraries when attempting to create the CUDA execution provider. Are the CUDA libraries you installed accessible in the PATH?

You can add something like this to dump the environment and check the contents of the PATH value. 

```c#
            IDictionary environmentVariables = Environment.GetEnvironmentVariables();
            foreach (DictionaryEntry de in environmentVariables)
            {
                Console.WriteLine("  {0} = {1}", de.Key, de.Value);
            }
```

Alternatively you could open onnxruntime_providers_cuda.dll in https://github.com/lucasg/Dependencies and check it can find all the necessary CUDA dlls.
